var EditTenantModal=function(){app.modals.EditTenantModal=function(){var n,i=abp.services.app.tenant,t=null;this.init=function(i){n=i;t=n.getModal().find("form[name=TenantInformationsForm]");t.validate()};this.save=function(){if(t.valid()){var r=t.serializeFormToObject();n.setBusy(!0);i.updateTenant(r).done(function(){abp.notify.info(app.localize("SavedSuccessfully"));n.close();abp.event.trigger("app.editTenantModalSaved")}).always(function(){n.setBusy(!1)})}}}}(jQuery);